import { BrowserRouter as Router, Route } from "react-router-dom";
import About from "../pages/About";
import Home from "../pages/Home";

export default () => (
  <Router>
      <Route exact path="/">
        <Home />
      </Route>
      <Route exact path="/about">
        <About />
      </Route>
  </Router>
);
